		cout << "\nОтвет: " << RES << "\n";
		break;
	case'*': // если пользователь выбрал умножение
		RES = A * B;
		cout << "\nОтвет: " << RES << "\n";
		break;
	case '/': // если пользователь выбрал деление
		if (B != 0) { // если делитель не равен нулю
			RES = A / B;
			cout << "\nОтвет: " << RES << "\n";
		}
		else { // если делитель равен нулю
			cout << "\nДеление на ноль!!!!\n";
		}
		break;
	default: // не является обязательным (но для данного примера обязателен)
		cout << "\nНекорректный оператор!!!!\n";
	}

}

